const Card = (props) => {
    return (
        <div className="pb-3 col-4 text-center px-0" >
            <div className="rounded-card shadow-lg pb-4 w-75" style={{overflow: "hidden"}}>
                <div className="card-img">
                    <img src={props.cardImage} className="w-100" style={{height:"350px"}}/>
                </div>
                <div className="card-custom-body">
                    <h4 className="title text-right">اسلام سعيد</h4>
                    <h6 className="subtitle text-muted text-right">مطور ويب واندرويد</h6>
                </div>
            </div>
        </div>
    )
};


export default Card;
